import './App.css';
import Navbar from './Components/Navbar.js';
import { useState } from 'react';
import Home from './Components/Home.js';
import About from './Components/About.js';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NoteState from './context/NoteState.js';
// import Login from './Components/Login.js';
import Login_Signup from './Components/Signup.jsx';
function App() {

    const [isLogin, setIsLogin] = useState(true);



  return (
  <>

  <NoteState>

  <Router>


<Navbar />

<Routes>
  <Route exact path='/' element={<Home />} />

 <Route exact path='/about' element={<About></About>} /> 

 <Route exact path='/signup' element={<Login_Signup setIsLogin={setIsLogin(false)} />} />

 <Route exact path='/login' element={<Login_Signup setIsLogin={setIsLogin(true)}/>}/>

</Routes>
  </Router>
  </NoteState>
  </>
  );
}

export default App;
